//SPDX-License-Identifier: MIT

pragma solidity ^0.8.16;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract DeXchange {
    address public feeAccount;
    uint256 public feePercent;

    mapping(address => mapping(address => uint256)) public tokensBalance;
    mapping(uint256 => Order) public orderBook;
    uint256 public orderCount;
    mapping(uint256 => bool) public orderCancelled;
    mapping(uint256 => bool) public orderFilled;

    event Deposit(
                address token,
                address user,
                uint256 amount,
                uint256 balance
    );

    event Withdraw(
                address token,
                address user,
                uint256 amount,
                uint256 balance
    );

    event OrderLogged(
                uint256 id,
                address user,
                address tokenGet,
                uint256 amountGet,
                address tokenGive,
                uint256 amountGive,
                uint256 timestamp
    );

    event Cancel(
                uint256 id,
                address user,
                address tokenGet,
                uint256 amountGet,
                address tokenGive,
                uint256 amountGive,
                uint256 timestamp
    );

    event Trade(
            uint256 id,
            address user,
            address tokenGet,
            uint256 amountGet,
            address tokenGive,
            uint256 amountGive,
            address creator,
            uint256 timestamp
        );

    // Order modeling
    struct Order {
        uint256 id;
        address user;
        address tokenGet;
        uint256 amountGet;
        address tokenGive;
        uint256 amountGive;
        uint256 timestamp;
    }

    constructor(address _feeAccount, uint256 _feePercent) {
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }

    //--------------------------
    // DEPOSIT & WITHDRAW TOKENS

    function depositToken(address _token, uint256 _amount) public {
        // Transfer tokens to exchange
        require(IERC20(_token).transferFrom(msg.sender, address(this), _amount), "depositToken: Error in depositing tokens");
        // update user balance
        tokensBalance[_token][msg.sender] += _amount;
        // Emit event
        emit Deposit(_token, msg.sender, _amount, tokensBalance[_token][msg.sender]);


    }

    function withdrawToken(address _token, uint256 _amount) public {
        // Ensure user has enough tokens to withdraw
        require(tokensBalance[_token][msg.sender] >= _amount);


        // Update the balance
         tokensBalance[_token][msg.sender] -= _amount;

        // Transfer tokens to the user
        IERC20(_token).transfer(msg.sender, _amount);

        // Emit an event
        emit Withdraw(_token, msg.sender, _amount, tokensBalance[_token][msg.sender]);
    }

    // check balance
    function balanceOf(address _token, address _user)
        public
        view
        returns (uint256) 
    {
        return tokensBalance[_token][_user];
    }

    //-------------------
    //MAKE & CANCEL ORDERS



    function makeOrder(
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
        )
        public
    {
        // Require token balance
        require(balanceOf(_tokenGive, msg.sender) >= _amountGive);

        // Instantiate ORDER
        orderCount++;

        orderBook[orderCount] = Order(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp 
        );

        emit OrderLogged(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );
    }

    function cancelOrder(uint256 _id) public {

        Order storage _order = orderBook[_id];

        require(address(_order.user) == msg.sender);

        require(_order.id == _id);

        orderCancelled[_id] = true;

        emit Cancel(
            _order.id,
            msg.sender,
            _order.tokenGet,
            _order.amountGet,
            _order.tokenGive,
            _order.amountGive,
            block.timestamp
        );
    }

    //------------------
    // Executing orders

    function fillOrder(uint256 _id) public {
        // 1. Must be valid orderId
        require(_id > 0 && _id <= orderCount, "Order does not exist");
        // 2. Order can't be filled
        require(!orderFilled[_id]);
        // 3. Order can't be cancelled
        require(!orderCancelled[_id]);





        Order storage _order = orderBook[_id];

        _trade(
            _order.id,
            _order.user,
            _order.tokenGet,
            _order.amountGet,
            _order.tokenGive,
            _order.amountGive
        );

        // Mark order as filled
        orderFilled[_order.id] = true;

    }

    function _trade(
        uint256 _orderId,
        address _user,
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
    ) 
        internal 
    {
        uint256 _feeAmount = (_amountGet * feePercent) / 100;

        // msg.sender is the user who filled the order, while _user is who created order
        tokensBalance[_tokenGet][msg.sender] -= (_amountGet + _feeAmount);
        tokensBalance[_tokenGet][_user] += _amountGet;

        // charge fee
        tokensBalance [_tokenGet][feeAccount] += _feeAmount;

        tokensBalance[_tokenGive][_user] -= _amountGive;
        tokensBalance[_tokenGive][msg.sender] += _amountGive;

        emit Trade(
                _orderId,
                msg.sender,
                _tokenGet,
                _amountGet,
                _tokenGive,
                _amountGive,
                _user,
                block.timestamp
        );
    }

}

